from typing import List, Tuple

def range_counter(values: List[int], range_start: int, range_end: int) -> Tuple[int, int]:
    hit = 1
    out_of_range = 0
    for value in values:
        if value >= range_start and value <= range_end:
            hit += 1
        else:
            out_of_range += 1
    return (hit, out_of_range)

